import React ,{Fragment} from 'react';
import { Link , withRouter } from 'react-router-dom';
import {isAuthenticated, signout } from '../auth/helper';



//based on the path changing color
const currentTab = (history ,path ) => {
    if(history.location.pathname === path){
        return {color:"#2ecc72"};
    } else {
        return {color:"#FFFFFF"};
    }
};


const Nav = ({history}) => (

    <div>
        <ul className="nav nav-tabs bg-dark">
            <li className="nav-item">
                <Link style={currentTab(history,"/")} className="nav-link "  to ="/">Home</Link>
            </li>
            <li className="nav-item">
                <Link style={currentTab(history,"/cart")} className="nav-link "  to ="/cart">Cart</Link>
            </li>
            <li className="nav-item">
                <Link style={currentTab(history,"/user/dashboard")} className="nav-link "  to ="/user/dashboard">U.Dashboard</Link>
            </li>
            <li className="nav-item">
                <Link style={currentTab(history,"/admin/dashboard")}  className="nav-link" to="/admin/dashboard">A.Dashboard</Link>
            </li>
            {!isAuthenticated() && (
        <Fragment>
          <li className="nav-item">
            <Link
              style={currentTab(history, "/signup")}
              className="nav-link"
              to="/signup"
            >
              Signup
            </Link>
          </li>
          <li className="nav-item">
            <Link
              style={currentTab(history, "/signin")}
              className="nav-link"
              to="/signin"
            >
              Sign In
            </Link>
          </li>
        </Fragment>
      )}
      {isAuthenticated() && (
        <li className="nav-item">
          <span
            className="nav-link text-warning"
            onClick={() => {
              signout(() => {
                history.push("/");
              });
            }}
          >Signout</span>
            </li>
            )}
        </ul>
    </div>
);




export default withRouter(Nav);
